            parent[x] = find(parent[x])
        return parent[x]
    def union(x,y):
        p_x = find(x)
        p_y = find(y)
        if p_x==p_y:
            return False
        if rank[p_x]>rank[p_y]:
            parent[p_y] = p_x
        elif rank[p_x]<rank[p_y]:
            parent[p_x] = p_y
        else:
            parent[p_y] = p_x
            rank[p_x]+=1
        return True
    count = 0
    for i in range(M):
        u,v,w = edge_list[i]
        if union(u,v):
            count+=w
    return count

