    for i in range(n):
        for j in range(i+1, n):
            total_distance += abs(distances[i] - distances[j])
    total_distance += abs(distances[n-1]-0) # add the distance from last destination to the starting point
    denominator = 2**(n-1) # total number of possible routes is 2^n-1 because for each destination we have two choices: visit it or not visit it
    numerator = 2*total_distance
