def bfs(x0, y0, x1, y1, segments):
    queue = [(x0, y0, 0)]
    visited = set()
    while queue:
        x, y, depth = queue.pop(0)
        if x == x1 and y == y1:
            return depth
        visited.add((x, y))
        for segment in segments:
            r, a, b = segment
            if x == r:
                for i in range(a, b+1):
                    if (x, i) not in visited:
                        if i < y:
                            queue.append((x, i, depth+1) if i > 0 else None)
                        if i > y:
                            queue.append((x, i, depth+1) if i < 10**9 else None)
        for segment in segments:
            a, b, c = segment
            if y == a:
                for i in range(a, c+1):
                    if (i, y) not in visited:
                        if i > x:
                            queue.append((i, y, depth+1) if i < 10**9 else None)
                        if i < x:
                            queue.append((i, y, depth+1) if i > 0 else None)
    return None

