def find_min_power(avengers, start, end, A, B):
    if end - start == 1:
        if avengers[start] == 0:
            return A
        else:
            return B
    power = float('inf')
    for i in range(start, end):
        left_power = find_min_power(avengers, start, i, A, B)
        right_power = find_min_power(avengers, i, end, A, B)
        total_power = left_power + right_power
        if avengers[start:end].count(1) > 0:
            total_power += B * avengers[start:end].count(1) * (end - start)
        else:
            total_power += A
        power = min(power, total_power)
    return power
