            for u in range(n):
                if a[v][u]!=float('inf') and not vis[u]:
                    if dist[u]>dist[v]+a[v][u]:
                        dist[u]=dist[v]+a[v][u]
                        heapq.heappush(heap,(dist[u],u)
        return dist
    ans=float('inf')
    for i in range(n):
        dist=dijkstra(a,i)
        ans=min(ans,np.sum(dist))
    return ans if ans<float('inf') else -1

