def check_intersection(p1, p2, p3):
    # Check if p1 and p2 intersect with p3
    x1, y1 = p1
    x2, y2 = p2
    x3, y3 = p3
    if x1 == x2 == x3:
        return False
    if y1 == y2 == y3:
        return False
    if x1 == x2 and x3 == y3:
        if y1 < y3 and y2 > y3 or y1 > y3 and y2 < y3:
            return True
    if y1 == y2 and x3 == x1:
        if x1 < x3 and x2 > x3 or x1 > x3 and x2 < x3:
            return True
    a = (y2-y1)/(x2-x1)
    b = (y3-y1)-a*(x3-x1)
    if a == (y3-y2)/(x3-x2):
        return False
    x4 = (b-y1)/(a-y2/x2-y1)
    if x4 >= min(x1, x2) and x4 <= max(x1, x2) and x4 >= min(x3, x2) and x4 <= max(x3, x2):
