def next_permutation(a):
    n=len(a)
    i=n-2
    while i>=0 and a[i]>a[i+1]:
        i-=1
    if i<0:
        return None
    j=n-1
    while a[j]<a[i]:
        j-=1
    a[i],a[j]=a[j],a[i]
    a[i+1:n]=a[n-1:i:-1]
    return a
