    for i in range(1, n):
        for j in range(1, k+1):
            for t in range(j+1):
                prob_matrix[i][j] += prob_matrix[i-1][t-1]*(1-p) + prob_matrix[i-1][t]*p

    # Calculate the probability of each player winning and sum them up
    prob_sum = 0
    for i in range(1, n):
        prob_sum += prob_matrix[n-1][i]

    # The probability of a draw is the complement of the probability of someone winning
    return round(1-prob_sum, 6)

