    # Define the Fenwick Tree class
    class FenwickTree:
        def __init__(self, size):
            self.size = size
            self.tree = [0] * (size + 1)

        def add(self, i, val):
            while i < self.size:
                self.tree[i] += val
                i += self._lowbit(i)

        def get_sum(self, i):
            s = 0
            while i > 0:
                s += self.tree[i]
                i -= self._lowbit(i)
            return s

        def _lowbit(self, i):
            return i & -i

