    dist[s] = 0
    while queue:
        d, i = heapq.heappop(queue)
        if i == t:
            break
        if d > dist[i]:
            continue
        for j, l in adj_list[i]:
            new_dist = d + l
            if new_dist < dist[j]:
                dist[j] = new_dist
                heapq.heappush(queue, (new_dist, j))

