def convex_hull(points):
    # Implement Graham scan algorithm to find convex hull of points
    # Code adapted from https://en.wikibooks.org/wiki/Algorithm_Implementation/Geometry/Convex_hull/Monotone_chain
    T = []
    points.sort()
    l = len(points)
    for p in points:
        while len(T) > 1 and cross(T[-2], T[-1], p) <= 0:
            T.pop()
        T.append(p)
    for p in points[-2::-1]:
        while len(T) > 1 and cross(T[-2], T[-1], p) <= 0:
            T.pop()
        T.append(p)
    T.pop()
    return T

