    if n == 1:
        return "Yes"
    root = -1
    for value in values:
        if all(value % i for i in range(2, value)):
            root = value
            break
    if root == -1:
        return "No"

    tree = [None] * n
    tree[0] = root
    for i in range(1, n):
        if values[i] % root != 0:
            return "No"
        if values[i] < root:
            tree[get_parent(tree, i - 1, root)] = values[i]
        else:
            tree[i] = values[i]

