class UnionFind:
    def __init__(self,n):
        self.parent=[i for i in range(n)]
    def find(self,x,y):
        return self.parent[x]==self.parent[y]
    def union(self,x,y):
        px,py=self.find(x),self.find(y)
        if px!=py:
            self.parent[px]=py
            return 1
        return 0
