def bfs(u,v,tree,n):
    visited=[False]*n
    q=[u]
    visited[u]=True
    dp=[-1]*n
    dp[u]=0
    while q:
        x=q.pop(0)
        for i,w in tree[x]:
            if not visited[i]:
                visited[i]=True
                dp[i]=dp[x]+w
                q.append(i)
    return dp[v]<=q

